import TeacherInfo from "./TeacherInfo";
import React from 'react'; 
const Teacher = () => {
    const teachers = [{
        name: 'Azamat',
        title:'developeer'
    }, {
        name: 'Nazerke',
        title:'backedn'
    }]
    return (
        <div className="teachers">
            {teachers.map(teacher=>(
                <TeacherInfo img = "team1.png" title = {teacher.name} text = {teacher.title}/>
            ))}

        </div>

    )
}

export default Teacher;
